sys_variable_value.value:
(function execute(inputs, outputs) {
  if(inputs["status"]==200) {
    var awardDetails = {};
    var award = JSON.parse(inputs["responseBody"]);

    awardDetails.period_of_performance_potential_end_date = award.period_of_performance.potential_end_date;
    awardDetails.recipient_name = award.recipient.recipient_name;
    awardDetails.awarding_agency_name = award.awarding_agency.toptier_agency.name;
    awardDetails.awarding_sub_agency_name = award.awarding_agency.subtier_agency.name;
    awardDetails.award_description = award.description;
    awardDetails.contracting_officers_determination_of_business_size_code = 'null';
    awardDetails.parent_award_agency_name = award.parent_award ? award.parent_award.agency_name : '';
    awardDetails.funding_office_name = award.funding_agency.office_agency_name;
    awardDetails.award_type = award.type_description;
    awardDetails.naics_code = award.naics_hierarchy.base_code.code;

    outputs['award'] = awardDetails;
  }

})(inputs, outputs);

